  //             <b>
  //               <u>{item.cartTotal}</u>
  //             </b>
  //           </td>
  //         </tr>
  //       </table>
  //     </div>
  //   );
  // });

  const columns = [
    {
      title: "ชื่อผู้ใช้",
      dataIndex: "orderdBy",
      render: (item, i) => <>{item.username}</>,
    },
    {
      title: "รายการสินค้า",
      render: (item, i) => (
        <ol>
    
          {item.products.map((p, i) => (
             
            <li>
              {p.product.title}
            </li>
           
          ))}
    
    </ol>
      ),
    },
    
    {
      title: "จำนวนสินค้า",
      render: (item, i) => (
        <>
          {item.products.map((p, i) => (
          
           
              <li>
                {p.count} ชิ้น
              </li>
           
          ))}
        </>
      ),
    },
    {
      title: "ราคารวมสุทธิ",
      dataIndex: "cartTotal",
      key: "cartTotal",
      render: (item, i) => (
        <>
              <li>
                {item} บาท
              </li>

        </>
      ),
    },
    {
      title: "ที่อยู่ผู้รับ",
      dataIndex: "orderdBy",
      render: (item, i) => <>{item.address}</>,
    },
    {
      title: "สถานะ",
      dataIndex: "orderstatus",
      key: "orderstatus",
    },
  
    {
      title: "อัพเดทสถานะ",
      render: (item) => (
        <select
